package com.hunter.study.algorithm.class03;import lombok.AllArgsConstructor;import java.util.Objects;/** * @Author 水木 * @Date 2021/2/22  4:06 下午 */@AllArgsConstructorpublic class Node<T> {	public T value;	public Node next;	public Node(T t) {		value = t;	}	@Override	public String toString() {		return value.toString();	}	public static void main(String[] args) {		Integer i = 3;		System.out.println(Objects.equals(i, 3));	}}